import React from 'react';
import logo from '../logo2.png';

const Home = () => {
  return (
    <div>
      <header className="App-header">
        <h1>Home Page</h1>
        <br />
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
};

export default Home;
